import { useState } from "react";

const initialState = [
  {
    name: "Macbook Pro",
    price: "2500",
    currency: "$",
    img: "",
  },
];

function modalWindow() {}

function Product(props) {
  const { elt } = props;
  return <>
    <img src={elt.img} width="3em" height="6em"></img>
  </>;
}

function App() {
  const [modal, showModal] = useState(false);

  return (
    <>
      <ul>
        {initialState.map((elt) => (
          <Product elt={elt} />
        ))}
      </ul>
    </>
  );
}

export default App();
